        Area Median (2001-2017)</Title>\n        <Abstract>These values represent
        the total greenness that occurs between green-up and green-down and is considered
        an important metric of productivity. Greenness is calculated from satellite
        sensors that measure light reflectance from vegetation. These values represent
        median cumulative greenness (as measured by the 2-band Enhanced Vegetation
        Index) for an individual pixel. That is, summed daily values of EVI2 between
        greenup and greendown. These data are preliminary or provisional and are subject
        to revision. They are being provided to meet the need for timely best science.
