        implied is made regarding the display or utility of the data on any other
        system or for general or scientific purposes, nor shall the act of distribution
        constitute any such warranty.&#13;\n&#13;\nDeveloper Notes: The daily minimum
        and maximum temperatures used to compute the agdds are available in the tmin
        and tmax layers of the climate workspace.</Abstract>\n        <KeywordList>\n
