        provisional and are subject to revision. They are being provided to meet the
        need for timely best science. The data have not received final approval by
        the U.S. Geological Survey (USGS) and are provided on the condition that neither
        the USGS nor the U.S. Government shall be held liable for any damages resulting
        from the authorized or unauthorized use of the data.&#13;\n&#13;\nDeveloper
        Notes: The daily minimum and maximum temperatures used to compute the agdds
        are available in the Tmin and Tmax layers of the climate workspace.</Abstract>\n
