        Annual Spring Indices (1880-2021), First Bloom</Title>\n        <Abstract>This
        layer is an annual representation of the days of year that the requirements
        for the first bloom Spring Index were met, averaged for Red Rothomagensis
        lilac, Arnold Red honeyusckle and Zabelii honeysuckle; available from 1880
        to 2021, calculated using BEST Tmin and Tmax data. The Extended Spring Indices
        are mathematical models that predict the \"start of spring\" (timing of leaf
        out or bloom) at a particular location. These data are preliminary or provisional
        and are subject to revision. They are being provided to meet the need for
        timely best science. The data have not received final approval by the U.S.
        Geological Survey (USGS) and are provided on the condition that neither the
        USGS nor the U.S. Government shall be held liable for any damages resulting
        from the authorized or unauthorized use of the data.</Abstract>\n        <KeywordList>\n
