        Indices, Current Year - First Bloom - Spring Index</Title>\n        <Abstract>This
        layer represents the progression of the first bloom Spring Index in the current
        year averaged for species Zabelii honeysuckle, Arnold Red honeysuckle Red
        Rothomagensis lilac; calculated using National Centers for Environmental Prediction
