        Indices, Current Year, Alaska - First Bloom - Spring Index</Title>\n        <Abstract>This
        layer represents the progression of the first bloom Spring Index in the current
        year averaged for species Zabelii honeysuckle, Arnold Red honeysuckle Red
        Rothomagensis lilac; calculated using National Centers for Environmental Prediction
        (NCEP) data. A cell is shaded for a given day of year once the Spring Index
        bloom requirements are met. A cell is not shaded until the requirements for
        each of the three species threshold models have been met. The Extended Spring
        Indices are  models that predict the \"start of spring\" (timing of leaf out
        or bloom) at a particular location.&#13;\n&#13;\nThese data are preliminary
        or provisional and are subject to revision. They are being provided to meet
