        \       <Abstract>This layer shows the difference, in days, between the Historical
        Annual Spring Index and the 30-Year Average Spring Index for first bloom,
        calculated using PRISM data. The layer shows how advanced or lagged the day
        of year of the first bloom index is for each year, compared to the long-term
        average day of year. The Extended Spring Indices are  models that predict
        the \"start of spring\" (timing of leaf out or bloom) at a particular location.&#13;\n&#13;\nThese
        data are preliminary or provisional and are subject to revision. They are
        being provided to meet the need for timely best science. The data have not
        received final approval by the U.S. Geological Survey (USGS) and are provided
        on the condition that neither the USGS nor the U.S. Government shall be held
        liable for any damages resulting from the authorized or unauthorized use of
        the data.&#13;\n&#13;\nDeveloper Notes: Negative values represent locations
        that have reached the SI-x requirements earlier than average, and positive
        values represent locations that have reached the SI-x requirements later than
        average.</Abstract>\n        <KeywordList>\n          <Keyword>WCS</Keyword>\n
