        opaque=\"0\">\n        <Name>si-x:bloom_return_interval</Name>\n        <Title>Spring
        Indices, Yearly Return Interval - Spring Index Bloom Return Interval</Title>\n
        \       <Abstract>The Spring Index Return Interval for first bloom represents
        the frequency with which spring is as late or early as it is in the current
        year. It serves to contextualize the current year's spring onset anomaly.
        For example, if the Daily Anomaly product shows first bloom occurring 20 days
        earlier than average, for a given location, the Return Interval product shows
        how often that location has experienced first bloom at least 20 days early.
        To create this product, the current year Spring Index Anomaly value is compared
        to the anomaly value for the preceding decades (2019 and 2020 are compared
        preceding 38 and 39 years respectively; 2021 and subsequent years are compared
        to the preceding 40 years). The frequency with which a spring was at least
        this early (or late) is calculated by taking the number of years in the record
        divided by the count of years that were earlier (or later) than the current
        year. Values of 0 represent average or \"on time\" springs. Negative values
        represent the frequency of early springs; positive values represent the frequency
        of late springs. Values of 41 represent the earliest (-41) or latest (41)
        spring on record.</Abstract>\n        <KeywordList>\n          <Keyword>six_bloom_return_interval</Keyword>\n
