        year for species Red Rothomagensis lilac, using National Centers for Environmental
        Prediction (NCEP) data. A cell is shaded for a given day of year once the
        Spring Index leaf requirements are met. The Extended Spring Indices are models
        that predict the \"start of spring\" (timing of leaf out or bloom) at a particular
        location.&#13;\n&#13;\nThese data are preliminary or provisional and are subject
