        opaque=\"0\">\n        <Name>inca:midgdown_median_nad83_02deg</Name>\n        <Title>Mid
        Green-down Median (2001-2017)</Title>\n        <Abstract>These values represent
        the day of year half-way between peak greenness and senescence and is considered
        an important metric of autumn leaf color change. Greenness is calculated from
        satellite sensors that measure light reflectance from vegetation. Each pixel
        value is calculated as the median day of year (2001-2017) at which the greenness
        of a pixel last reached 50% of it's annual maximum (i.e. during senescence).
        Values greater than 365 indicate that the greendown occurred after to Dec
        31st, but the date of maximum greenness occurred prior to Dec 31st. These
        data are preliminary or provisional and are subject to revision. They are
        being provided to meet the need for timely best science. The data have not
        received final approval by the U.S. Geological Survey (USGS) and are provided
        on the condition that neither the USGS nor the U.S. Government shall be held
        liable for any damages resulting from the authorized or unauthorized use of
        the data.</Abstract>\n        <KeywordList>\n          <Keyword>WCS</Keyword>\n
