        Green-up TSslope (2001-2017)</Title>\n        <Abstract>Theil-Sen slope magnitude
        for pixels where the associated p-value is less than or equal to 0.05. It
        represents the change (days per year) of the MidGreenup value over the period
        2001-2017. The Theil-Sen estimator is more resistant to outliers than linear
        regression equivalents. It is calculated as the median of the slopes of lines
        between all possible point pairs (i.e. day of year of MidGreenup and its calendar
        year). These data are preliminary or provisional and are subject to revision.
