        opaque=\"0\">\n        <Name>gdd:red_brome_senescence</Name>\n        <Title>Red
        Brome Senescence</Title>\n        <Abstract>The USA-NPN red brome forecast
        predicts flowering and senescence in real-time. The red brome forecast is
        based on Prevy et al (in prep.), which predicts phenology of the species
        based on temperature (growing degree days, GDD) and daylength. Daily GDD accumulations
        are calculated using the simple averaging method, and adjusted based on daylength,
        where longer days are assumed to promote plant development. The photoperiod
        adjustment is calculated as [daylength hours]/[24]. Each day's growing degree
        day accumulation is multiplied by the photoperiod adjustment. The flowering
        model uses a Dec 1 start date and a 23F base temperature.  \"Flowering soon\"
        is predicted at 1283 GDDs (F), after which another week of average temperatures
        at 70F with 11 hours of daylight would be needed to trigger flowering. \"Onset
        of flowering\" is predicted at 1441 GDDs (F).  The senescence model uses a
        Jan 1 start date and a 32F base temperature.&#13;\n\"Starting to dry out and
        senesce\" is predicted at 886 GDDs (F), after which another week of average
        temperatures of 80F and 14 hours of daylight would be needed to trigger senescence.
        \"Senescence\" is predicted at 1081 GDDs (F).</Abstract>\n        <KeywordList>\n
