        \       <Abstract>The USA-NPN winter wheat development forecast predicts the
        developmental stage of winter wheat from emergence through seed development
        in real-time. The USA-NPN winter wheat development forecast is based on the
        CERES-wheat model (Ritchie 1991), which predicts developmental stage using
        temperature, sun angle, and varietal inputs. The USA-NPN winter wheat development
        forecast approximates across varieties to provide a general forecast for winter
        wheat development and may reflect developmental stage in some varieties more
        closely than others.&#13;\nWinter wheat developmental stages are estimated
        as a function of accumulated growing degree days (GDDs). As described in Ritchie
        (1991), daily GDD accumulations are calculated using a Jan 1 start date, 32F
        base temperature, and the simple averaging method. Daily GDD accumulations
        are penalized based on whether vernalization requirements have been met and
        the number of hours of daylight at that location. All calculations and values
        are in Farenheit. &#13;\nTo determine the vernalization penalty for each pixel,
        first, vernalization days are calculated as follows. If the daily average
        temperature (Tavg) falls between 32-44.6F, the day is considered a full VD.
        If the daily average temperature falls between 44.6-64.4F, a fraction of a
        VD is calculated using the formula (approximated from Ritchie 1991, Fig 3-1):
        [Fraction VD = -0.06(Tavg) + 3.38]. The vernalization penalty for a location
        on a given day is a function of VDs, calculated using the formula (approximated
        from Ritchie 1991, Fig 3-2): [VDPenalty = 0.005(VDs) + 0.75]. Once a pixel
        reaches 50VDs, the vernalization penalty is no longer calculated. The photoperiod
        penalty for each pixel is calculated using the formula (approximated from
        Ritchie 1991, Fig 3-3): [PhotoperiodPenalty =  1.0 - 0.0025*(20 - (hours daylight))2)].
        The GDD accumulation for each pixel is penalized (reduced) for each pixel
        by multiplying it by either the VDPenalty or the PhotoperiodPenalty, whichever
        value is smaller.&#13;\nRitchie, J.T. 1991. Wheat phasic development. p.31-54.
        In Hanks and Ritchie (ed.) Modeling Plant and Soil Systems. Agronomy Monograph
        31, ASA, CSSSA, SSSA, Madison, WI.</Abstract>\n        <KeywordList>\n          <Keyword>winter_wheat</Keyword>\n
