        \       <Abstract>This layer represents the progression of the first bloom
        Spring Index in the current year for species Zabelii Honeysuckle, using National
        Centers for Environmental Prediction (NCEP) data. A cell is shaded for a given
        day of year once the Spring Index leaf requirements are met. The Extended
        Spring Indices are models that predict the \"start of spring\" (timing of
        leaf out or bloom) at a particular location.&#13;\n&#13;\nThese data are preliminary
        or provisional and are subject to revision. They are being provided to meet
        the need for timely best science. The data have not received final approval
        by the U.S. Geological Survey (USGS) and are provided on the condition that
        neither the USGS nor the U.S. Government shall be held liable for any damages
        resulting from the authorized or unauthorized use of the data.</Abstract>\n
